import Coin from "./Coin";

const Desc = (props) => {
  return (
    <>
      <h1>Yo hhhhddddd</h1>
      {props.desc.map((coin) => {
        return (
          <div className="description-container">
            <Coin
              name={coindesc.name}
              symbol={coindesc.symbol}
              image={coindesc.image}
              marketcap={coindesc.marketCap}
              coinprice={coindesc.current_price}
              rank={coindesc.market_cap_rank}
              circulating={coindesc.circulating_supply}
            />
          </div>
        );
      })}
    </>
  );
};

export default Desc;
